<template>
  <div class="avatar">
    <img :src="avatar" alt="Avatar"/>
  </div>
</template>

<script>
// noinspection JSUnusedGlobalSymbols
export default {
  name: 'AvatarPicture',
  props: {
    file: {
      type: Object,
      default: null,
    },
    thumbnail: {
      type: Boolean,
      default: false,
    },
  },
  computed: {
    avatar() {
      let avatar;

      if (!this.file) {
        avatar = 'data:image/png;base64,';
      } else {
        avatar = `${process.env.VUE_APP_PUBLIC_BUCKET}${this.thumbnail ? 'thumbnails/' : ''}${this.file.fileName}`;
      }

      return avatar;
    },
  },
};
</script>
